sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  var inputString = inputs.array_string.toString();
  var editString = inputString;
  if (inputString.substring(0,1) == '[') {
    var editString = inputString.substring(1,inputString.length-1);
  }
  editString = inputString.substring(1,inputString.length-1);
  outputs.output_array = editString.split(',');


})(inputs, outputs);

